import "./Register.css"
//import axios from "axios"
//import { useHistory } from "react-router-dom"

const Register = () => {

    //const history = useHistory()

    const [user, setUser] = useState({
        name: "",
        email: "",
        password: "",
        reEnterPassword: ""
    })

    const handleChange = e => {
        const { name, value } = e.target
        setUser({
            ...user,
            [name]: value
        })
    }

    // const register = () => {
